/* CSS Criado para o teste da IGS Brasil por Thiago Bernardi */

@font-face {
  font-family: 'FrutigerLTStd';
  src: url('../FrutigerLTStd-Black.woff') format('woff');
}

@keyframes animarAoCarregar {
  0% {
  }
  50% {
    -webkit-transform: scale(1.1) rotate(4deg);
    transform: scale(1.1) rotate(4deg);
  }
  100% {
  }
}

body {
  background-image: url(../images/background.png);
  font-family: 'FrutigerLTStd', Fallback, sans-serif;
  margin: 0px;
}

.container {
  display: flex;
  flex-direction: column;
  /* flex-flow: row wrap; */
  max-width: 1920px;
  margin: 0 auto;
  height: 100vh;
  /* justify-content: center; */
}

.header {
  background-image: url(../images/header.png);
  /* flex: 1; */
  background-size: cover;
  width: 100%;
  /* flex-direction: row; */
  justify-content: center;
  max-height: 180px;
  /* height: 180px; */
  display: flex;
  align-content: center;
}

/* Botes: */

header button {
  background-color: Transparent;
  background-repeat: no-repeat;
  border: none;
  cursor: pointer;
  overflow: hidden;
  /* outline: none; */
}

.btlogout,
.bthelp {
  height: 50%;
  margin-top: 14px;
  margin-left: 16px;
}

.btlogout {
  background-image: url('../images/logout_idle.png');
  background-size: cover;
  width: 13%;
}

.btlogout:hover {
  background-image: url('../images/logout_pressed.png');
}

.bthelp {
  background-image: url('../images/help_idle.png');
  background-size: cover;
  width: 13%;
}

.bthelp:hover {
  background-image: url('../images/help_pressed.png');
}

.btsaldooff {
  background-image: url('../images/eye_idle.png');
  background-size: cover;
  height: 29%;
  width: 20%;
  margin-top: -6px;
  margin-right: 0px;
}

.btsaldooff:hover {
  background-image: url('../images/eye_pressed.png');
}

.btsaldoon {
  background-image: url('../images/eye_off_idle.png');
  background-size: cover;
  /* background-color: Transparent;
  background-repeat: no-repeat;
  border: none;
  cursor: pointer;
  overflow: hidden; */
  height: 29%;
  width: 20%;
  margin-top: -6px;
  margin-right: 0px;
}

.btsaldoon:hover {
  background-image: url('../images/eye_off_pressed.png');
}
/* Fim botes */

.menu-caixa {
  flex: 1;
  display: flex;
}

.jackpot {
  justify-content: flex-start;
  flex-direction: column;
  align-content: center;
  align-items: center;
  display: flex;
}
header span {
  background: linear-gradient(2deg, #fed600 0%, #fabc03 75%, #fed802 100%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  -webkit-text-stroke: 1px black;
}

.jackpottitulo {
  font-size: 19px;
  margin-top: 13px;
  text-transform: uppercase;
}

.status {
  /* width: 200px; */
  justify-content: flex-end;
}
.statussaldo {
  display: flex;
  margin-top: -5%;
  margin-right: 11%;
  align-content: center;
  align-items: center;
  column-gap: 23px;
  width: 46%;
}
.statuscifrao {
  font-size: 30px;
}
.status button img {
  height: 40px;
}

.jackpotvalor {
  font-size: 5vw;
}

.premio {
  display: flex;
  align-items: center;
}

.jackpotcifrao {
  font-size: 23px;
}

.jogocifrao {
  font-size: 14px;
}

.jogovalor {
  font-size: 22px;
}

.jogocentavos {
  font-size: 14px;
}

.jogocifrao,
.jogovalor,
.jogocentavos {
  background: linear-gradient(2deg, #fed600 0%, #fabc03 75%, #fed802 100%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  -webkit-text-stroke: 1px black;
}

.jogodescricaoespecial {
  background: none !important;
}

.jogodescricaoesptexto {
  font-size: 14px;
  margin-bottom: 8px;
  color: white;
  text-shadow: 2px 2px 5px black;
}

main {
  display: flex;
  justify-content: center;
  flex: 1;
  /* width: 100%; */
}

footer {
  background-image: url(../images/footer.png);
  width: 100%;
  justify-content: center;
  display: flex;
  align-content: center;
  height: 36px !important;
}

/* Estilos do Slider */

.swiper {
  margin-top: 10px;
  width: 100%;
  height: 100%;
}

.swiper-slide {
  text-align: center;
  font-size: 18px;
  display: -webkit-box;
  display: -ms-flexbox;
  display: -webkit-flex;
  display: flex;
  -webkit-box-pack: center;
  -ms-flex-pack: center;
  -webkit-justify-content: center;
  justify-content: center;
  -webkit-box-align: center;
  -ms-flex-align: center;
  -webkit-align-items: center;
  align-items: center;

  width: 60% !important;
  justify-content: center;
  flex-wrap: wrap;
  align-content: center;
  flex-direction: column;
  height: 443px !important;
}

.swiper-wrapper {
  align-items: center;
}

/* .swiper-slide img {
  display: block;
  width: 100%;
  height: 100%;
  object-fit: cover;

} */

.swiper-slide figure {
  /* width: 100%;
    height: 100%; */
  border: double 0px transparent;
  border-radius: 22px;
  /* background-image: linear-gradient(white, white),
    linear-gradient(to right, green, gold); */
  /* background-origin: border-box;
  background-clip: content-box, border-box; */
  box-sizing: border-box;
  -moz-box-sizing: border-box;
  -webkit-box-sizing: border-box;
  border: 4px solid #fbe3a0;
  border-style: ridge;
}

.swiper-slide figcaption {
  background-image: url(../images/barra_jackpot.png);
  background-size: cover;
  width: 87%;
  height: 17%;
  display: flex;
  align-items: flex-end;
  display: flex;
  align-items: flex-end;
  justify-content: center;
}

.swiper-slide .jogo {
  min-width: 220px;
  cursor: pointer;
  width: calc(25% - 20px);
  height: calc(25% - 20px);
  margin: 10px;
  background-image: url(../images/icon_idle.png);
  background-size: cover;
  display: flex;
  align-items: flex-end;
  justify-content: center;
  min-height: 194px;
}

.swiper-slide .jogo0 {
  background-image: url(../images/jogo00.png);
  height: 100%;
}
.swiper-slide .jogo1 {
  background-image: url(../images/jogo01.png);
}
.swiper-slide .jogo2 {
  background-image: url(../images/jogo02.png);
}
.swiper-slide .jogo3 {
  background-image: url(../images/jogo03.png);
}
.swiper-slide .jogo4 {
  background-image: url(../images/jogo04.png);
}
.swiper-slide .jogo5 {
  background-image: url(../images/jogo05.png);
}

.grow-rotate-on-hover {
  display: inline-block;
  vertical-align: middle;
  box-shadow: 0 0 1px rgba(0, 0, 0, 0);
  -webkit-transition-duration: 0.3s;
  transition-duration: 0.3s;
  -webkit-transition-property: transform;
  transition-property: transform;
  animation-duration: 0.5s;
  /* animation-timing-function: ease-in-out; */
  animation-delay: 0s;
  animation-iteration-count: 2;
  animation-direction: alternate-reverse;
  animation-name: animarAoCarregar;
}
.grow-rotate-on-hover:hover,
.grow-rotate-on-hover:focus,
.grow-rotate-on-hover:active {
  -webkit-transform: scale(1.1) rotate(4deg);
  transform: scale(1.1) rotate(4deg);
}

.swiper-button-prev:after,
.swiper-rtl .swiper-button-next:after {
  content: none !important;
}

.swiper-button-prev,
.swiper-rtl .swiper-button-next {
  left: 28px !important;
  right: auto;
}

.swiper-slide-prev::before {
  content: '';
  /* background: linear-gradient(
    to right,
    rgba(23, 70, 210, 1) 80%,
    rgba(255, 0, 0, 0)
  ); */
  background: radial-gradient(
    closest-side,
    rgba(23, 70, 210, 0.8) 85%,
    rgba(255, 0, 0, 0)
  );
  height: 100%;
  width: 100%;
  display: block;
  opacity: 1;
  position: absolute;
}
.swiper-slide-next::before {
  /* background: rgba(23, 70, 210, 1) ; */
  content: '';
  /* background: linear-gradient(
    to left,
    rgba(23, 70, 210, 1) 80%,
    rgba(255, 0, 0, 0)
  ); */

  background: radial-gradient(
    closest-side,
    rgba(23, 70, 210, 0.8) 85%,
    rgba(255, 0, 0, 0)
  );
  height: 100%;
  width: 100%;
  display: block;
  opacity: 1;
  position: absolute;
}

.swiper-pagination-bullet {
  display: inline-block;
  height: 34px !important;
  width: 34px !important;
  background-color: transparent !important;
  background-image: url(../images/pagination_off.png) !important;
  background-size: cover !important;
  padding: 0px !important;
  opacity: 1 !important;
  border-radius: 0 !important;
}

.swiper-pagination-bullet-active {
  background-image: url(../images/pagination_on.png) !important;
  background-size: cover !important;
  padding: 0px !important;
}

.swiper-pagination {
  margin-top: -38px;
  position: relative !important;
  text-align: center;
  transition: 300ms opacity;
  transform: translate3d(0, 0, 0);
  z-index: 10;
}

/* Fim dos estilos do Slider */

.modal-flex {
  display: flex;
  justify-content: center;
  align-items: center;
}

.modal {
  display: none;
}

.modal {
  display: none;
}
.modal-mostrar,
.modal-esconder {
  display: flex;
}

.modal--align {
  width: 100%;
  height: 100%;
  position: fixed;
  left: 0;
  top: 0;
  background: rgba(0, 0, 0, 0.7);
  z-index: 999;
}

.modal_container {
  position: relative;
  width: 100%;
  height: 53%;
  max-width: 604px;
  max-height: 800px;
  padding: 20px;
  margin: 12px;
  background-image: url('../images/box_help.png');
  background-size: cover;
  z-index: 99;
}

.modal_wrapper {
  display: flex;
  flex-direction: column;
  height: 100%;
  justify-content: space-between;
}

.btfecharmodal:hover {
  cursor: pointer;
  background-image: url('../images/btn_exit_help_pressed.png');
}

.btfecharmodal {
  margin-top: -10px;
  background-color: Transparent;
  border: 0;
  width: 35px;
  height: 35px;
  background-size: cover;
  background-image: url('../images/btn_exit_help_on.png');
}

.modal_conteudo {
  height: 100%;
  color: white;
  font-family: Arial, Helvetica, sans-serif;
  font-weight: 100;
  overflow: scroll;
  border: black 1px dotted;
  padding: 4px;
  margin-top: 7px;
  margin-bottom: 13px;
}

.modal_cabecalho {
  display: flex;
  width: 100%;
}

.modal_cab_titulo {
  flex: 10;
  color: white;
  font-family: Arial, Helvetica, sans-serif;
}

/* Animacoes Modal */

/* Abrir modal */
.modal.modal-mostrar {
  animation: modal-open 1s;
}

@keyframes modal-open {
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}

/* Fechar Modal */
.modal.modal-esconder {
  animation: modal-close 1s;
}

@keyframes modal-close {
  0% {
    opacity: 1;
  }
  100% {
    opacity: 0;
  }
}
